        return(
            <>
            <Sidebar />
            </>
            )
        return(
            <div className="Header">
                <p>Welcome to Student Esports society </p>
                <div className="slideshow">
                    <img src = "valorant.png">

                    </img>
                </div>
                </div>

        );
    }
}
export default HomePage;
